        <script>
        var glviewer = null;
        var jviewer = null;
        $(document).ready(function() {
        	var moldata = $("#moldata").val();
            glviewer = WebMol.createViewer("gldiv");	
            glviewer.setBackgroundColor(0xffffff);
            var m = glviewer.addModel(moldata,"pdb");

            glviewer.zoomTo();
            glviewer.render();
            
            jviewer = WebMol.createViewer("jmoldiv");    
            jviewer.setBackgroundColor(0xffffff);
            var m = jviewer.addModel(moldata,"pdb");

            jviewer.zoomTo();
            jviewer.render();
            
        });
        </script>
